import React from 'react';
import Login from '../Login';
import { Navigate, Outlet } from 'react-router-dom';

function ProtectedRoute({stat}){
  return Login.isLogedIN==="true"?<Outlet/>:<Navigate to="/"/>;
}

export default ProtectedRoute
